import Book from "./Book";

const Read = ({
  read,
  moveToShelf,
  getStatus
}) => {
  return (
    <
    div className = "bookshelf" >
    <
    h2 className = "bookshelf-title" > Currently Reading < /h2> <
    div className = "bookshelf-books" >
    <
    ol className = "books-grid" > {
      read.map((book, index) => {
        return ( <
          li key = {
            index
          } >
          <
          Book book = {
            book
          }
          onMoveToShelf = {
            (e) => moveToShelf(e, book)
          }
          getStatus = {
            getStatus
          }
          />


          <
          /li>

        )
      })
    }


    <
    /ol> <
    /div> <
    /div>
  );
}

export default Read;
